import React, { useState, useEffect, useRef } from "react";
import { Link } from "react-router-dom";

export default function Home() {
    return (
       
        <div className="content">
           
                <div className="classic-mode game-mode">
                    Classic
                </div>
            

            <div className="online-mode game-mode">
                Online
            </div>

            <div className="computer-mode game-mode">
                Computer
            </div>
        </div>
    );
};
